import img1 from './img/img1.jpg'
import img2 from './img/img2.jpg'
import img3 from './img/img3.jpg'

const data = {
    productData:[
        {
            id: 1,
            img: img1,
            title: 'Cheese Quesadilla',
            desc: 'The Original',
            price: 5,
        },
        {
            id: 2,
            img: img2,
            title: 'Chicken + Cheese Quesadilla',
            desc: 'Now with fresh shredded chicken',
            price: 6,
        },
        {
            id: 3,
            img: img3,
            title: 'Dillosauce',
            desc: 'Pairs great with a fresh Quesadilla',
            price: 2,
        }
    ],
};

export default data;
